import React, { useState } from "react";
import axios from "axios";
import { response } from "express";

const recommend = () => {
    
    const url = "https://www.baidu.com/s?wd=%E9%A3%9F%E7%89%A9";
    const [recommends, setProduct] = useState(null);


    axios.get(url)
        .then(response => {
            setProduct(response.data)
        })
    
    return ( 
        <div>
            <h1>Done!</h1>
        </div>
     );
}
 
export default recommend;
